import React, { Component } from "react";
import { TextInput, Row, Col } from "react-materialize";
class Login extends Component {
    render() {
        return (
            <div>
                <Row>
                    <Col m={4}>

                    </Col>
                    <Col m={4}>
                        <h3> Login</h3>
                    </Col>
                </Row>
                <form method='POST'>
                    <TextInput email label='Email' validate />
                    <TextInput label='Password' password />
                </form>
            </div>
        );
    }
}
export default Login;
